DROP TABLE IF EXISTS `t_work_order_report_cart`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_work_order_report_cart` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '序号',
  `order_desc` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '维修描述',
  `order_line_no` varchar(20) CHARACTER SET utf8 NOT NULL COMMENT '工单跟踪号',
  `status` varchar(1) CHARACTER SET utf8 DEFAULT NULL COMMENT '工单状态',
  `equipments_id` bigint(20) DEFAULT NULL COMMENT '设备',
  `eq_class_id` bigint(20) DEFAULT NULL COMMENT '设备分类',
  `locations_id` bigint(20) DEFAULT NULL COMMENT '位置',
  `report_time` datetime DEFAULT NULL COMMENT '报修时间',
  `reporter` varchar(20) CHARACTER SET utf8 DEFAULT NULL COMMENT '报修人员',
  `report_type` varchar(1) CHARACTER SET utf8 DEFAULT NULL COMMENT '报修方式',
  `creator` varchar(20) CHARACTER SET utf8 DEFAULT NULL COMMENT '创建人员',
  `location` varchar(20) CHARACTER SET utf8 DEFAULT NULL COMMENT '位置编号',
  `vlocations_id` bigint(20) DEFAULT NULL COMMENT '位置',
  `node_state` varchar(45) CHARACTER SET utf8 DEFAULT NULL COMMENT '节点状态',
  `unit_id` bigint(20) DEFAULT NULL COMMENT '维修单位',
  `fix_desc` varchar(45) CHARACTER SET utf8 DEFAULT NULL COMMENT '维修描述',
  `dead_line` datetime DEFAULT NULL COMMENT '维修截止时间',
  `last_status_time` datetime DEFAULT NULL COMMENT '最近状态时间',
  `expired` bit(1) DEFAULT b'0' COMMENT '过期标识',
  PRIMARY KEY (`id`),
  UNIQUE KEY `UK_49k1hcvtocqubtr41ge8sijgp` (`order_line_no`),
  KEY `FK_f5yd6cqs1oh198nr7h92xv9us` (`equipments_id`),
  KEY `FK_hlh5e0ta6i47yy84akbonfnda` (`eq_class_id`),
  KEY `FK_svfd537ndcbo68ddoco09pact` (`locations_id`),
  KEY `FK_k6huh87p6voh4gwaeow7yvhox` (`unit_id`),
  CONSTRAINT `FK_f5yd6cqs1oh198nr7h92xv9us` FOREIGN KEY (`equipments_id`) REFERENCES `t_equipments` (`id`),
  CONSTRAINT `FK_hlh5e0ta6i47yy84akbonfnda` FOREIGN KEY (`eq_class_id`) REFERENCES `t_equipments_classification` (`id`),
  CONSTRAINT `FK_k6huh87p6voh4gwaeow7yvhox` FOREIGN KEY (`unit_id`) REFERENCES `t_outsourcing_unit` (`id`),
  CONSTRAINT `FK_svfd537ndcbo68ddoco09pact` FOREIGN KEY (`locations_id`) REFERENCES `t_locations` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1928 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='工单报修信息表';
